import birthcal from "./asset/BirthIcon.svg";
import femaleicon from "./asset/FemaleIcon.svg"
import phoneicon from "./asset/PhoneIcon.svg"

const Jessicadata=[
    {
        img:birthcal,
        inputname:"Date Of Birth",
        inputval:"August 23, 1996",
    },
    {
        img:femaleicon,
        inputname:"Gender",
        inputval:"Female",
    },
    {
        img:phoneicon,
        inputname:"Contact info",
        inputval:"(415)555-1234",
    },
    {
        img:phoneicon,
        inputname:"Emergency Contacts",
        inputval:"(415)555-5658",
    },
    {
        img:phoneicon,
        inputname:"Insurance Provider",
        inputval:"Sunrise Health Assurance",
    },



        
        


]
export default Jessicadata;
